import { configureStore, createSlice } from "@reduxjs/toolkit";
import userEvent from "@testing-library/user-event";

let cart = createSlice({
  name : 'cart',  
  initialState : [
    {
      id : 0, 
      title : '샤인머스캣케이크', 
      count : 2,
      price : '55,000원'
    },
    {
      id : 2, 
      name : '꽈배기도넛', 
      count : 1,
      price : '55,000원'
    }
  ]
})


export default configureStore({
  reducer:{
    user : cart.reducer,
  }
})
